import React, {useState} from 'react';
import Axios from'axios';
import '../App.css'
import './patient.css'

function Patients() {

    const[list, setList]=useState([])
    const [patient_name,setuserName]=useState('')
    const [patient_gender,setpassword]=useState('')
    const [patient_age,setstatus]=useState( )
    
    const getData = () => {
        Axios.post('http://localhost:3001/patients').then(res => {
            setList(res.data)
        })
    }
    
    getData()
    return(
      <div >
        <div className='patients'>
        <h1>List of Patients</h1>
        </div>  
        <table id = 'patients' style={{alignItems: 'center',
            justifyContent: 'center', display: 'flex', height:'70vh'}}>
      {/* <thead>
      <th>userName</th><th>password</th><th>status</th><th>&nbsp;</th>
      </thead> */}
      <tbody>
      {list.map((val,key)=>{
        return(
          <tr style={{boxShadow: '10px 10px 5px grey', backgroundColor: '#c4d8e2',
          border:'5px', borderSpacing: '0 15px', width: '150px', textAlign:'center',
          float: 'right'}}>
            <td>{val.patient_name}
            </td>
            <td>{val.patient_gender}
            </td>
            <td>{val.patient_age}
            </td>
            <td>
            <div className="button">
                  <button className="btn btn-primary btn-block" type="submit" style={{ backgroundColor: '#0072c6', color: 'white'}}>General Report</button>
                </div>
            </td>
            <td>
            <div className="button">
                  <button className="btn btn-primary btn-block" type="submit" style={{ backgroundColor: '#0072c6', color: 'white'}}>Report</button>
                </div>
            </td>
            <td>
            <div className="button">
                  <button className="btn btn-primary btn-block" type="submit" style={{ backgroundColor: '#0072c6', color: 'white'}}>Chat</button>
                </div>
            </td>
            <td>
            <div className="button">
                  <button className="btn btn-primary btn-block" type="submit" style={{ backgroundColor: '#0072c6', color: 'white'}}>Call</button>
                </div>
            </td>
          </tr>
        )
      })}
      </tbody>
    </table>
        </div>
    )

}
export default Patients;
